import { useHistory } from "react-router";
import "./Search.css"
import { useState, useEffect } from "react"
import Axios from "axios"
import {useLayoutEffect} from  "react"
import TextField from "@material-ui/core/TextField";
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';




let options = []

function Search() {
    let [selectedOption, setSelectedOption] = useState(null);
    let [cars, setCars] = useState([null])
    let [colors, setColors] = useState(null)



    const styles = {
        app: {
            backgroundColor: 'rgba(0, 0, 0, 0.1)',
            justifyItems: 'center',
            alignItems: 'center',
            display: 'grid',
            height: '100vh',
            fontFamily: 'Arial',
            color: 'rgba(0,0,100,1)',
            gridTemplateColumns: '1fr',
            fontSize: 25
        },
        select: {
            width:'100%',
            maxWidth: 600
        }
    }

    useEffect(() => {
        Axios.get('http://localhost:3001/auto', {
        }).then((response) => {
                setCars(response.data.cars)
                setColors(response.data.colors)
                for (let i = 0; i < response.data.cars[0].length; i++) {
                    options.push({label: cars[0][i].name, value: cars[0][i].name})
                }
        })
}, [])


    return (
        <div>
            <div className="Search" style={styles.app}>
                    <Select options={options}/>
                    <TextField
                        label="Select"
                        helperText="Please select your currency"
                    />
            </div>

        </div>
    );
}

  export default Search;
